import React from 'react';
import {Link} from 'react-router-dom'


// KOMPONENT  WYSWIETLAJACY MENU //

class AppHeader extends React.Component {
  

 
  render() {
    return(
      <div className='App-Menu'>
        <div className="Menu-option">
        <Link to="/"><p className="main-button">Homepage</p> </Link>
        <Link to="/findsound"><span className="main-button">Find Sound</span> </Link>
        <Link to="/findartist"><span className="main-button" >Find Artist</span> </Link>
        <Link to="/findgenres"><span className="main-button">Find Genres</span></Link>
        <Link to="/findalbum"> <span className="main-button" >Find Album</span></Link>
        <Link to="/favourite"><span className="main-button">Favourite</span> </Link>
        </div>  
      </div>
    )
  }
}

export default AppHeader;
